  assign io_prediction_ready = io_PC_next_ready;
  assign io_PC_next_valid = ~flushing_event;
  assign io_PC_next_bits_addr = PC_mux;
  assign io_PC_next_bits_wr_data = 32'h0;
  assign io_PC_next_bits_wr_en = 1'h0;
