                io_deq_ready,
  output        io_deq_valid,
  output [6:0]  io_deq_bits_RD,
  output [31:0] io_deq_bits_RD_data,
  output        io_deq_bits_RD_valid,
  output [31:0] io_deq_bits_fetch_PC,
